gazeta_pl.notSupportedBrowserBannerInfo = function () {

    function init() {
        var actualdDate = Math.floor(Date.now() / 1000);

        if (actualdDate <= 1601503140){ // new Date('September 30, 2020 23:59:00'); 
            getFile("ieBrowserSupportBeforeEnd");
        } else {
            getFile("ieBrowserSupportEnd");
        }
    }
    
    function getFile(file) {
        var src = '/aliasy/hp2018/browserSupportBox/' + file + '.htm';
        var xhr = new XMLHttpRequest();
        xhr.addEventListener("load", function() {
            if (xhr.status === 200) {
                showInformation(xhr.response);
            } else {
                throw 'Response status ' + xhr.status + '. Address: ' + file + '.htm';
            }
        });

        xhr.addEventListener("error", function() {
            console.warn('Error: ' + file + '.htm');
        });

        xhr.open("GET", src, true);
        xhr.send();
    }

    function showInformation(data) {
        var DOMmodal = document.createElement("div");
        DOMmodal.innerHTML = data;
        document.body.appendChild(DOMmodal);
        document.body.classList.add("ie-showBrowserInformation");
        if(document.querySelector(".ie-closeButton")){
            document.querySelector(".ie-closeButton").addEventListener("click", hideInformation); 
        }
        if(document.querySelector(".ie-acceptButton")){
            document.querySelector(".ie-acceptButton").addEventListener("click", hideInformation); 
        }
    }
    function hideInformation() {
        document.body.classList.remove("ie-showBrowserInformation");
    }
    return {init: init};
}();

if(isIE11){// jshint ignore:line
    gazeta_pl.notSupportedBrowserBannerInfo.init();
}
